    "gotorole":"Role A",
    "form_inputs":["Address","Full Name"]
}

*/
    try {
        const dataToSave = await data.save();
        res.status(200).json(dataToSave)
    }
    catch (error) {
        res.status(400).json({message: error.message})
    }
}

